 * GER translation of “Telefon und/ oder Faxkosten” to “Mobile phone/telephone/fax costs/internet costs” and ENG translation of “Phone /Fax expenses” to “Mobile phone/telephone/fax costs/internet costs”

2. We will update GL accounts for receipts (column F for domestic, column G for international):
